function Movie({ coverImg, title, summary, genres }) {
    return (
        <div>
            <img src={coverImg}/>
            <h2>{title}</h2>
            <p>{summary}</p>
            <ul>
                { genres.map((g, gi) => <li key={gi}>{g}</li>) }
            </ul>
        </div>
    );
}

export default Movie;
